import request from "./api";
import axios from 'axios';
const type="ABOUT_CONTENT_DATA_SUCCESS"
export function aboutContentDataSuccess(aboutContent) {
    return {
        type: type,
        payload: aboutContent
    }
}
export const aboutContentData =  (url) => async dispatch => {
    const res = await axios.get(url)
    dispatch(aboutContentDataSuccess(res.data))
}
